;(function () {
    const htmlTagsArray = ['video','bwp-video'];
    const htmlTagsArraytring = htmlTagsArray.join(',');
    const title = document.title;
    log({ name: 'LINK START' });
    window.log = log;
    document.addEventListener('visibilitychange', pageSwitch);
    function log(params) {
        var styles = 'color: #796;font-weight: bold';
        return console.log(`%c ${params?.name || params}`, params?.styles || styles);
    };
    function pageSwitch() {
        document.querySelectorAll('iframe').forEach(ele => {
            if (ele.contentDocument !== null && ele.contentDocument.documentElement !== null){
                ele.contentDocument.documentElement.querySelectorAll(htmlTagsArraytring).forEach(el => playOrPause(el));
            }
        });
        document.querySelectorAll(htmlTagsArraytring).forEach(el => playOrPause(el));
    };
    function playOrPause(el) {
        if (document.hidden) {
            el.pause();
            document.title = '自动暂停';
        } else {
            el.play();
            document.title = title;
        }
    };
})();